import { useNavigate } from "react-router-dom";
import { Card } from "../../components/Card";
import { RestaurantWrapper } from "./styles";

export const RestaurantView = () => {
  const navigate = useNavigate();

  function onSelectRestaurant(restaurantId: string) {
    navigate(`/restaurant/${restaurantId}`);
  }

  return (
    <RestaurantWrapper>
      <header className="search-container">
        <input
          placeholder="Busque o restaurante"
          type="text"
          className="search-input"
        />
        <button className="search-button">Buscar</button>
      </header>

      <div className="body">
        <Card
          title="Lanche da Deh"
          description="Comidas funcionais"
          imageUrl="data:image/jpeg;base64,"
          onClick={() => onSelectRestaurant("lanche-deh")}
        />
        <Card
          title="Lanche do Pina"
          description="So verdinha"
          imageUrl="data:image/jpeg;base64,"
          onClick={() => onSelectRestaurant("lanche-pina")}
        />
      </div>
    </RestaurantWrapper>
  );
};
